import React from 'react';
import ReactDOM from ''

// ChildComponent
function ChildComponent(props) {
  return (
    <div>
          <p>{prop}</p>
    </div>
  );
}

// ParentComponent
function ParentComponent() {
  const name = "John Doe";
  return (
    <div>
          <ChildComponent prop={name} />
    </div>
  );
}

ReactDOM.render(
    <ParentComponent />,
    document.getElementById('root')
);
